import React, { useEffect } from "react";
import store from "store";
import { Redirect } from "react-router";

export default props => {
  useEffect(async () => {
    const token = store.get("token");
    if (!token) {
      props.history.push("/login");
    } else {
      
      store.remove("token");
      props.history.push("/login");
    }
  }, []);
  return <div />;
};
